import { useEffect, useState } from "react";
import { Button } from "react-bootstrap";
import Square from "./Square";

function Attributes(props) {
  return (
    <div id="Attributes" className="bg-secondary">
      <p id="att">
        {props.winner === "#60a569"
          ? "First player wins"
          : "Second player wins"}{" "}
        <br /> click the reset button{" "}
      </p>
      <Button
        style={{ marginTop: "-10px" }}
        onClick={() => {
         this.style.display = "none";

          setTimeout(() => {
            document.getElementById("Attributes").style.display = props.style;
          }, 2500);
        }}
      >
        See the Board
      </Button>
    </div>
  );
}
export default Attributes;
